import React, { Component } from 'react';
import HEREMap from 'react-here-maps';
 
export default class Geosuggest extends Component {
    render() {
        return (
            <HEREMap
                appId="mx9ip6iLmmuFAIwgDqeC"
                appCode="M5eYt9TlSIhd9_W7cFJaoL9EMjyGim2VeN2ghW0Ipv8"
                center={{ lat: 0, lng: 0 }}
                zoom={14}
            />
        )
    }
}
